import React, { useEffect, useState } from "react";
import { authAxios } from "../authaxios/auth/authaxios";
import "../App.css";
const Main = () => {
  const [userData, setUserData] = useState([]);
  const [data , setdata] = useta

  function GetData() {
    authAxios
      .get("GetData")
      .then((res) => {
        setUserData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }

  useEffect(() => {
    GetData();
  }, []);

  return (
    <div>

   <form onSubmit={handle}>

       <input type="text" placeholder="name" />
       <input type="text" placeholder="email"/>
   </form>


      <table>
        <thead>
          <th>S.no</th>
          <th>Name</th>
          <th>Email</th>
          <th>actions</th>
        </thead>
        <tbody>
          {userData &&
            userData.map((v, i) => {
              let { email, name } = v;

              return (
                <tr key={i}>
                  <td>{i + 1}</td>
                  <td>{name}</td>
                  <td>{email}</td>
                  <td>
                    <button>edit</button> <button>delete</button>
                  </td>
                </tr>
              );
            })}
        </tbody>
      </table>
    </div>
  );
};

export default Main;
